INSERT INTO `wpposts` VALUES (36,2,'2015-02-28 13:49:02','2015-02-28 12:49:02','<h3 style=\"color: #0081b6;\">Mes grands-mères tant paternelles que maternelles possédaient un don de voyance.</h3>\r\n<p style=\"color: #0081b6;\">J’ai pris conscience assez jeune que j’avais fréquemment de fortes intuitions qui se révélaient exactes.</p>\r\n<p style=\"color: #0081b6;\">Après plusieurs années de réflexion, j’ai décidé de vous faire bénéficier de ce don et ainsi apporter une réponse claire à vos questions, lever jusqu’au moindre de vos doutes et vos incertitudes en relation à votre passé, votre présent et votre futur, vous aider à réparer vos blessures intérieures afin de rendre meilleur votre quotidien.</p>\r\n<p style=\"color: #0081b6;\">Indépendamment de mon ressenti, je conforte mes prédictions par le maniement du pendule et la maitrise de divers tarots dont le Petit Lenormand et l’Ancien Tarot de Marseille.</p>\r\n<p style=\"color: #0081b6;\">Je serai heureuse de pouvoir vous accueillir sur ma ligne et concourir à éclairer tous sujets dans le domaine familial aussi bien que financier, affectif, professionnel et autre et peut-être également pouvoir partager avec vous les joies retrouvées.</p>\r\n\r\n<h3 style=\"color: #0081b6;\"><em><strong>Testez-moi gratuitement, envoyez une question, accompagnée de votre nom, prénom, date de naissance et région. Je vous répondrai maximum dans les 48 heures.</strong></em></h3>\r\n<p style=\"color: #0081b6;\"><a style=\"color: #1155cc;\" href=\"mailto:alexandra@voyance-au-telephone.be\" target=\"_blank\">alexandra@voyance-au-telephone.be</a></p>\r\n<p style=\"color: #0081b6;\">A très bientôt…</p>\r\n<p style=\"color: #0081b6;\">Belgique: 0907 /88 371 (1,50€/min)</p>\r\n<p style=\"color: #0081b6;\">Luxembourg: 901/ 47 028 (1,15€/min)</p>\r\n&nbsp;','Alexandra, voyance par téléphone.','','inherit','open','open','','17-revision-v1','','','2015-02-28 13:49:02','2015-02-28 12:49:02','',17,'http://alexandra.sublime-voyance.be/17-revision-